import React from 'react';
import { useParams } from 'react-router-dom';

function Portfolio() {
  const { username } = useParams();
  
  return (
    <div style={{ padding: '20px' }}>
      <h1>Portfolio: {username}</h1>
      <p>Public portfolio view</p>
    </div>
  );
}

export default Portfolio;
